import React, { Suspense } from "react";
import DashboardWrapper from "./modules/Dashboard/DashContext";
import RouterComponent from "./Routes/Route";
import { AuthWrapper } from "./modules/User/Authentication";

const App = () => {
  return (
    <Suspense>
    <DashboardWrapper>
      <AuthWrapper>
        <RouterComponent />
      </AuthWrapper>
    </DashboardWrapper>
    </Suspense>
  );
};

export default App;
